fn get_next_line<T: io::BufRead>(iter: &mut<io::Lines<T> as IntoIterator>::IntoIter) -> Result<String, io::Error> {
    match iter.next() {
        Some(val) => val,
        None => Err(io::Error::new(io::ErrorKind::Other, "Line not found"))
    }
}

fn run_ba1a() -> Result<usize, Box<dyn Error>> {
    let file = File::open("/Users/adamstrandberg/rust/rustalind/src/problem_data/ba1a.txt")?;
    let mut lines = io::BufReader::new(file).lines();
    let text : String = get_next_line(&mut lines)?;
    let pattern : String = get_next_line(&mut lines)?;
    Ok(chapter_1::ba1a::kmer_count(&text, &pattern))
}

fn run_ba1b() -> Result<Vec<String>, Box<dyn Error>> {
    let file = File::open("/Users/adamstrandberg/rust/rustalind/src/problem_data/ba1b.txt")?;
    let mut lines = io::BufReader::new(file).lines();
    let text : String = get_next_line(&mut lines)?;
    let k : usize = get_next_line(&mut lines)?.parse()?;

    let kmers = chapter_1::ba1b::most_frequent_kmers(&text, k);
    let mut new_kmers = Vec::new();
    for kmer in kmers.iter() {
        new_kmers.push(String::from(*kmer));
    };
    Ok(new_kmers)
}

